import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const IndicacaoScreen = () => {
  const indicacoes = [
    'Filme 1',
    'Filme 2',
    'Filme 3',
    
    'Filme 4',
    'Filme 5'
  ];

  return (
    <View style={styles.container}>
      <Text style={styles.title}>Filmes que Indico</Text>
      {indicacoes.map((filme, index) => (
        <Text key={index} style={styles.filme}>{filme}</Text>
      ))}
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  title: {
    fontSize: 24,
    fontWeight: 'bold',
  },
  filme: {
    fontSize: 18,
    marginVertical: 4,
  },
});

export default IndicacaoScreen;
